defineService({name:"Example Ticker",onStart:async e=>{e.state.count=0,Neo.log.info("Ticker service started"),e.state.intervalId=setInterval(()=>{e.state.count+=1,Neo.log.debug("Tick #"+e.state.count)},5e3)},onStop:async e=>{e.state.intervalId&&clearInterval(e.state.intervalId),Neo.log.info("Ticker service stopped after "+e.state.count+" ticks")}});
